window.bookSummaryJSON = "<p>Camila was 17 when Van Quiso kidnapped her. Ten years after her escape, the shackles refuse to release her. Not while there are still slave traders preying on her city. </p> <p>She will stop at nothing to end them. Even if that means becoming a slave again. </p> <p>Returning to chains is her worst fear - and only option. They won’t know who she is or what she intends to do. She’s prepared for every complication. </p> <p>Except him. The one who decimated her 16-year-old heart. </p> <p>Matias is charming, gorgeous, and dangerously seductive. He’s also untrustworthy and enshrouded in secrets. After years of no contact, he finds her - on her knees, wrists bound, in the clutches of her enemy. </p> <p>Will he sabotage her mission by needlessly saving her? </p> <p>Or will he keep her in chains and never let her go? </p> <p><i>HEA with no cliffhanger.</i></p>"; 
